export default function coin({name,icon,price,symbol}) {
  return (
    <div className="coin">
        <h1>Name: {name}</h1>
        <img src={icon} className="img"/>
        <h3>Price:{price} </h3>
        <h3>Symbol: {symbol}</h3>
    </div>
  )
}
